import React from 'react';
import {Component} from 'react';
import Header from './Header.js';
import MafiaChat from './MafiaChat.js';

class Mafia extends Component{
  render(){
    return(
      <React.Fragment>
        <Header/>
        <MafiaChat/>
      </React.Fragment>
    )
  }
}

export default Mafia
